.sogou.com/v67887040.htm','中国民族音乐是指用中国传统乐器以独奏、合奏形式演奏的民间传统音乐。民族器乐曲按传统习惯分为“单曲”与“套曲”两类。民族器乐有各种乐器的独奏、各种不同乐器组合的重奏与合奏。中国民族器乐的历史悠久。从西周到春秋战国时期民间流行吹笙、吹竽、鼓瑟、击筑、弹琴等器乐演奏形式，那时涌现了师涓、师旷等琴家和著名琴曲《高山》和《流水》等。秦汉时的鼓吹乐，魏晋的清商乐，隋唐时的琵琶音乐，宋代的细乐、清乐，元明时的十'),(3041,'国宾护卫队 - 搜狗百科','http://baike.sogou.com/v8654480.htm','国宾护卫队，又名国宾摩托车护卫队。摩托车护卫是多数国家给予到访外国元首、政府首脑等政要的一种最高礼遇和一项严格安全保卫措施，是国际上很多国家通行做法，执行这项任务的护卫队被人们称为行进中的“护卫使者”，流动的“仪仗队”。1954年6月，中国政府下令在迎送外国元首仪式中增设国宾车队摩托车护卫。1954年10月19日，印度总理兼外长尼赫鲁成为摩托护卫队护卫的第一名国宾。截至2003年，国宾护卫队共安全'),(3042,'搜狗视频 - 上网从搜狗开始','http://v.sogou.com/v?query=','搜狗视频，视频聚合平台，拥有全网更新更热视频内容。为用户提供高清电影,电视剧,动漫,综艺等视频在线观看，以及视频搜索等服务'),(3043,'世界卫生组织 - 搜狗百科','http://baike.sogou.com/v69978.htm','世界卫生组织（英文名称：World Health Organization，缩写WHO，中文简称世卫组织）是联合国下属的专门机构，总部设置在瑞士日内瓦，于1948年4月7日成立。\n世界卫生组织是国际上最大的政府间卫生组织，只有主权国家才能参加，其主要职能包括促进流行病和地方病的防治；提供和改进公共卫生、疾病医疗和有关事项的教学与训练等。\n2021年3月30日，中国-世卫组织新冠病毒溯源联合研究报告'),(3044,'徐锦江 - 搜狗百科','http://baike.sogou.com/v95388.htm','徐锦江（1961年10月13日-），出生于黑龙江牡丹江市，毕业于广州美术学院，中国香港男演员。\n徐锦江早年拜国画大师关山月为师学习国画，1981年考入无线电视艺员训练班后，开始在中国香港发展。他于1983年正式踏入演艺圈，由于外型较刚强，多饰演反派。被香港导演麦家兄弟发掘后，他进入事业高潮期，拍摄了大量电影作品。除影视成就外，徐锦江的艺术造诣也相当深厚，曾举办多次画展，还是相声大师唐杰忠的关门弟子'),(3045,'老年人 - 搜狗百科','http://baike.sogou.com/v114617.htm','老年人（The old）是指60周岁以上的人，其中中国《老年人权益保障法》第2条规定老年人的年龄起点标准是60周岁，即凡年满60周岁的中华人民共和国公民都属于老年人。\n2021年5月11日，第七次全国人口普查结果显示，中国60岁及以上人口为26402万人，占18.70%，其中，65岁及以上人口为19064万人，占13.50%，人口老龄化程度进一步加深。不同的文化圈对于老年人有着不同的定义，由于生命'),(3046,'德尔塔 - 搜狗百科','http://baike.sogou.com/v206633470.htm','德尔塔（Delta），学名:Lineage B.1.617.2，也被称为VUI（Variant Under Investigation）-21APR-01，俗称印度变种病毒。已知的严重急性呼吸系统综合征冠状病毒两变种之一。2020年10月5日在印度首次被发现，是一个双突变变体。双突变是指B.1.617的突变位置位于SARS-CoV-2尖峰蛋白的编码序列中的E484Q和L452R。\n2021年5月3'),(3047,'首页\n            - 搜狗百科','http://baike.sogou.com/usercenter/home.v','搜狗百科是搜狗搜索为广大用户所提供的一部自由、开放、共享的百科全书。旨在创造一个涵盖所有知识领域，服务于全部互联网用户的高质量内容平台。'),(3048,'里奥·梅西 - 搜狗百科','http://baike.sogou.com/v9457523.htm','里奥·梅西（Lionel Messi，1987年6月24日-），出生于阿根廷圣菲省罗萨里奥，阿根廷足球运动员，司职前锋，绰号“小跳蚤”，现效力于巴黎圣日耳曼足球俱乐部。被认为是世界球坛史上最佳球员之一。\n梅西5岁时就开始在家乡的地区少年队踢球，年幼时就展现出了惊人的足球天赋。2000年，13岁的梅西被巴塞罗那球探看中，加入拉玛西亚青训营。2005年，梅西帮助阿根廷U20夺得世青赛冠军，2008年夺'),(3049,'Sina Visitor System','http://weibo.com/sosobaike','无法获取此页的描述。'),(3050,'中国高校分类','http://baike.sogou.com/zt/gxbk/index.html','无法获取此页的描述。'),(3051,'趵突泉 - 搜狗百科','http://baike.sogou.com/v6019.htm','趵突泉位于山东省济南市历下区，南靠千佛山，东临泉城广场，北望大明湖、五龙潭。趵突泉面积达158亩，是以泉为主的国家AAAAA级旅游景区特色园林、国家首批重点公园。\n趵突泉位居济南七十二名泉之首，被誉为“天下第一泉”，也是最早见于古代文献的济南名泉。\n趵突泉是泉城济南的象征与标志，与济南千佛山、大明湖并称为济南三大名胜。趵突泉周边的名胜古迹枚不胜数，尤以泺源堂、观澜亭、尚志堂、李清照纪念堂、李苦禅纪'),(3052,'网络游戏 - 搜狗百科','http://baike.sogou.com/v34829.htm','网络游戏（Online Game）指用户通过计算机互联网进行交互娱乐的电子游戏，通常以互联网为传输媒介，以游戏运营商服务器和用户计算机为处理终端，以游戏客户端软件为信息交互窗口。网络游戏能实现娱乐、休闲、交流和取得虚拟成就等娱乐目标。网络游戏区别与单机游戏而言的，是指玩家必须通过互联网连接来进行多人游戏。 一般指由多名玩家通过计算机网络在虚拟的环境下对人物角色及场景按照一定的规则进行操作以达到娱乐'),(3053,'蜗牛 - 搜狗百科','http://baike.sogou.com/v4861546.htm','蜗牛（学名：Fruticicolidae），软体动物门腹足纲动物，是陆地上最常见的软体动物，具有很高的食用和药用价值。\n蜗牛有甲壳，形状像小螺，颜色多样化，头有四个触角，走动时头伸出，受惊时则头尾一起缩进甲壳中，取食植物，产卵于土中或者树上。其喜欢在阴暗潮湿、疏松多腐殖质的环境中生活，昼伏夜出，最怕阳光直射，对环境反应敏感，世界各地广布。蜗牛的整个躯体包括眼、口、足、壳、触角等部分，身背螺旋形的贝'),(3054,'搜狗百科知识图谱','https://baike.sogou.com/zstp','搜狗百科知识图谱'),(3055,'百科热词团','http://baike.sogou.com/rz/hotbk/index.html','无法获取此页的描述。'),(3056,'首页\n            - 搜狗百科','http://baike.sogou.com/usercenter/mygrowtask.v','搜狗百科是搜狗搜索为广大用户所提供的一部自由、开放、共享的百科全书。旨在创造一个涵盖所有知识领域，服务于全部互联网用户的高质量内容平台。'),(3057,'搜狗百科爱心公益基金','http://baike.sogou.com/welfare','搜狗百科爱心基金是搜狗百科推出的长期公益项目，将与腾讯公益及其他公益组织合作，定期推出公益项目，以“积分”兑换“爱心卡”的形式，将知识分享转换为爱心捐助，共建温暖和谐的社会！'),(3058,'希腊 - 搜狗百科','http://baike.sogou.com/v43086.htm','希腊共和国（希腊语：Ελληνική Δημοκρατία，英语：The Hellenic Republic；简称\"希腊\")，是地处欧洲东南角、巴尔干半岛的南端的共和制国家。\n希腊共和国由半岛南部的伯罗奔尼撒半岛和爱琴海中的3000余座岛屿共同构成。希腊为连接欧亚非的战略要地，本土从西北至正北部分别邻阿尔巴尼亚、马其顿、保加利亚三国，东北与土耳其国境接壤。周围则自东而西分别濒临爱琴海、地中海本域与'),(3059,'搜狗百科\n            - 搜狗百科','https://baike.sogou.com/task/activity/task.v?taskId=1854','搜狗百科是搜狗搜索为广大用户所提供的一部自由、开放、共享的百科全书。旨在创造一个涵盖所有知识领域，服务于全部互联网用户的高质量内容平台。'),(3060,'搜狗推广服务管理系统','http://bo.sogou.com/queryAgent.jsp','无法获取此页的描述。'),(3061,'Sina Visitor System','https://weibo.com/sogoumarketing?sudaref=fuwu.sogou.c