baidu.com/item/Dan%20Wilson/18644873','Dan Wilson是一名演员，代表作品有《温蒂和露西》。'),(8184,'花叶龙血树_百度百科','https://baike.baidu.com/item/%E8%8A%B1%E5%8F%B6%E9%BE%99%E8%A1%80%E6%A0%91/864396','为多年生的草本植物。单干，形态与朱蕉相似。叶呈长椭圆状披针形，于茎的周围呈螺旋状生长，顶部幼叶表面有绿色和黄色纵列条纹，而以黄色所占的宽度较大，色泽鲜艳，但老叶色彩不甚明显。性喜阳光和疏松肥沃的土壤，耐寒力较强。可用插条繁殖。'),(8185,'百度百科_V百科_浅析人类吃瓜行为','https://baike.baidu.com/vbaike/detail?itemId=85030','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8186,'登录百度帐号','https://baike.baidu.com/usercenter/tasks','百度帐号是登录所有百度系产品的通行证，登录后还可以在帐户管理页管理/修改您的个人信息，包括修改密码、绑定手机、身份认证等'),(8187,'中国举重队_百度百科','https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%E4%B8%BE%E9%87%8D%E9%98%9F','中国举重队，奥运冠军团队，包括中国女子举重队和中国男子举重队,是中国体育军团的王牌之师，多次在国际大赛上斩金夺银，为祖国赢得众多荣誉。中国举重队号称梦之队，尤其是中国女子举重队长期处于世界举坛霸主地位。2016年12月15日，获得2016CCTV体坛风云人物年度最佳团队奖提名奖。2021年7月24日，侯志慧夺得2020年东京奥运会女子举重49公斤级金牌，并打破奥运会纪录 。7月25日，李发彬夺得2020年东京奥运会举重男子61公斤级金牌，并打破奥运会纪录。7月25日晚，谌利军夺得2020年东京奥运会男子举'),(8188,'国家文化公园_百度百科','https://baike.baidu.com/item/%E5%9B%BD%E5%AE%B6%E6%96%87%E5%8C%96%E5%85%AC%E5%9B%AD','国家文化公园是国家推进实施的重大文化工程。2019年12月5日，中共中央办公厅、国务院办公厅印发《长城、大运河、长征国家文化公园建设方案》。2020年11月，国家文化公园办公室面向社会公开征集国家文化公园形象标志设计方案。2021年4月21日，国家文化公园工作推进座谈会暨“中国建筑文化研究会文化公园工作委员会”成立仪式在京举行。建设国家文化公园，是以习近平同志为核心的党中央的重大决策部署，是推动新时代文化繁荣发展的重大工程。中宣部、国家发展改革委、文化和旅游部等国家文化公园建设工作领导小组各组成单位和有关'),(8189,'刺槐优树-J22_百度百科','https://baike.baidu.com/item/%E5%88%BA%E6%A7%90%E4%BC%98%E6%A0%91-J22/20381232','刺槐优树-J22是属于蝶形花科刺槐属植物，英文名cihuaiyoushu-J22，产于美国。来源地是美国。'),(8190,'蝌蚪团_百度百科','https://baike.baidu.com/kedou','蝌蚪团_百度百科'),(8191,'百度百科：特色词条_百度百科','https://baike.baidu.com/item/%E7%99%BE%E5%BA%A6%E7%99%BE%E7%A7%91%EF%BC%9A%E7%89%B9%E8%89%B2%E8%AF%8D%E6%9D%A1','特色词条，曾定名为“优秀词条”，是由百科任务评审团成员评审并授予“特色词条”徽帜的词条，它是百科词条的典范之作，具有较强的知识性和专业性，且用词规范、行文有据、阐释适度、通俗易懂、排版美观，符合互联网阅读习惯。特色词条是百度百科继优质版本系列（图片、初级、中级、高级）之后，推出的授予较高质量词条的一种荣誉称号，与之前针对“版本”的评价方式不同，特色词条的评选标准，将针对整个词条，不再要求某一个用户贡献的多寡，而是对一个词条内容积累的肯定。各分类词条编辑指南的拓展、维护和管理工作由百科分类拓展委员会负责。各'),(8192,'精致苏州_百度百科','https://baike.baidu.com/item/%E7%B2%BE%E8%87%B4%E8%8B%8F%E5%B7%9E/5748