知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8205,'百度一下，你就知道','http://news.baidu.com/ns?tn=news&cl=2&rn=20&ct=1&fr=bks0000&ie=utf-8&word=','全球领先的中文搜索引擎、致力于让网民更便捷地获取信息，找到所求。百度超过千亿的中文网页数据库，可以瞬间找到相关的搜索结果。'),(8206,'烟袋斜街（北京市地安门烟袋斜街）_百度百科','https://baike.baidu.com/item/烟袋斜街/4303903','烟袋斜街位于北京市地安门外大街鼓楼前，属西城区厂桥地界。在清末至二三十年代，街内以经营旱烟袋、水烟袋等烟具、古玩、书画、裱画、文具及风味小吃、服务行业等为主，其铺面建筑风格朴素并有北京北城特点，是北京北城较有名气的文化街，曾留下不少文化名人的足迹。烟袋斜街已经和鼓楼，南锣鼓巷等知名景区一样，都是每个在北京的人闲暇时寻找美食，看古玩，赏书画古建筑的好去处。'),(8207,'Scott Aukerman_百度百科','https://baike.baidu.com/item/Scott%20Aukerman/18744925','Scott Aukerman是一名演员，代表作品有《苦难成就喜剧》。'),(8208,'百度百科-知识专题','https://baike.baidu.com/wapui/subpage/knowledgetopic?id=061aa7ee66b1bbb08a38b052&amp',''),(8209,'秒懂五千年_百度百科','https://baike.baidu.com/item/秒懂五千年','“秒懂五千年”是百度百科2018年全新推出的科普中国传统文化原创动画栏目。该栏目构思新颖风趣幽默，遵循中国历史的发展脉络引出了一个个生动有趣的传统文化故事，为青少年再现了中华民族五千年璀璨的文明。'),(8210,'沙丁鱼（鲱形目鲱科动物）_百度百科','https://baike.baidu.com/item/沙丁鱼/425328','沙丁鱼（Sardine）是硬骨鱼纲鲱形目鲱科沙丁鱼属、小沙丁鱼属和拟沙丁鱼属及鲱科某些食用鱼类的统称。也指制成油浸鱼罐头的普通鲱（Clupea harengus）以及其它小型的鲱或鲱状鱼。沙丁鱼在香港被人们称沙甸鱼，又称萨丁鱼、鳁和鰯。小者长二寸，大者尺许，下颚较上颚略长，齿不显，背苍腹白，肉美，多用来制为罐头食品。最初在意大利萨丁尼亚捕获而得名，古希腊文称其“sardonios”意即“来自萨丁尼亚岛”。分布于南北纬度6～20度的等温带海洋区域中。沙丁鱼主要用作食用，但鱼肉亦可制为动物饲料。沙丁鱼油的用途'),(8211,'一号701的个人主页_百度百科','https://baike.baidu.com/usercenter/userpage?uname=%E4%B8%80%E5%8F%B7701&from=home','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8212,'百度百科——博物馆计划','https://baike.baidu.com/museum','百度百科博物馆计划，是百度百科与全国的知名博物馆合作，共同开发的互联网平台。通过音频讲解、实境模拟、立体展现等多种形式，让用户通过互联网即可身临其境地观赏珍贵展品，更便捷地获取信息、了解知识。'),(8213,'懂啦','https://child.baidu.com','懂啦APP，小知识，大世界，一看就懂啦'),(8214,'百度百科_V百科_中国著名运动员②','https://baike.baidu.com/vbaike/detail?itemId=85044','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8215,'没有姓名可怜娃的个人主页_百度百科','https://baike.baidu.com/usercenter/userpage?uname=%E6%B2%A1%E6%9C%89%E5%A7%93%E5%90%8D%E5%8F%AF%E6%80%9C%E5%A8%83&from=home','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8216,'齐民友_百度百科','https://baike.baidu.com/item/%E9%BD%90%E6%B0%91%E5%8F%8B','齐民友（1930年2月—2021年8月8日），祖籍安徽，出生于安徽省芜湖市，中国共产党优秀党员，著名数学家、教育家，武汉大学原校长、数学与统计学院教授、博士生导师。1948年考入武汉大学数学系，1949年3月加入中国共产党，1952年毕业留校任教，国家恢复职称评定后，1979年晋升为教授，1981年被国务院学位委员会评定为首届博士生导师，1982年7月至1988年4月担任武汉大学副校长，1988年4月至1992年10月担任武汉大学校长，2000年光荣离休。齐民友因病医治无效于2021年8月8日17：17分'),(8217,'美食（味美的食物）_百度百科','https://baike.baidu.com/item/美食/554260','美食，顾名思义就是美味的食物，贵的有山珍海味，便宜的有街边小吃。其实美食是不分贵贱的，只要是自己喜欢的，都可以称之为美食。中国素有“烹饪王国”这个美誉。在中国这个大家庭里，有五十六个小家庭，每个家庭都有自己的特色美食。美食吃前有期待、吃后有回味，享受美食也要看场合，场合好美食吃起来才有味道。世界各地美食文化博大精深，营养物质各不相同，品味更多美食，享受更多健康，也让人吃的更加开心。美食不仅仅是餐桌上的食物。还包括休闲零食、各种饼干、糕点、糖类，蜜饯、干果、肉制'),(8218,'百科热词团队_百度百科','https://baike.baidu.com/item/百科热词团队','百科热词团队（Encyclopedia of Top Searched Keywords Team）是百度百科核心用户团队，主要负责热点词条挖掘、更新、完善及添加热点特型模块等，每天分享最新热点知识。百科热词团队由热爱知识分享、编辑能力优秀的科友汇聚而成。团队成员用最快的速度将最新的热点内容编辑更新词条，同时将高质量信息整理发布，满足大家阅读的需求。他们每天服务着数亿网友对知识的需求。百科热词团队在百科官方的引导下快速成长，团队成员用自己的付出不断传递着热词团队快捷、准确、高质的内容理念。积极参与来实现团'),(8219,'Jaran Ngamdee_百度百科','https://baike.baidu.com/item/Jaran%20Ngamdee/18912789','Jaran Ngamdee是一名演员，代表作《火云盗》。'),(8220,'中国青年五四奖章_百度百科','https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%E9%9D%92%E5%B9%B4%E4%BA%94%E5%9B%9B%E5%A5%96%E7%AB%A0','中国青年五四奖章（China youth Wusi Medal），是共青团中央、中华全国青年联合会授予中国14至40周岁（年满14周岁、不满40周岁）优秀青年的最高荣誉。旨在树立政治进步、品德高尚、贡献突出的优秀青年典型，集中反映当代青年的精神品格和价值追求。2021年5月3日，第25届中国青年五四奖章评选结果揭晓。2021年8月9日，共青团中央、全国青联发布关于授予中国奥运健儿中国青年五四奖章的决定。'),(8221,'秒懂星课堂_百度百科','https://baike.baidu.com/item/%E7%A7%92%E6%87%82%E6%98%9F%E8%AF%BE%E5%A0%82?fr=home','“秒懂星课堂”是百度百科2017年推出的明星短视频栏目。邀请时下热门明星录制3分钟左右短视频，向大众分享一个知识点，让复杂的知识更简单的同时，带你了解明星的另一面。'),(8222,'百科商城_百度百科','https://baike.baidu.com/mall','百科商城是为了奖励百科上热心贡献词条的科友们而提供的财富值消费平台。使用财富值可以兑换特权道具、精美礼品，还能抽奖试试手气！更多精彩兑换持续上架中！'),(8223,'川野太郎_百度百科','https://baike.baidu.com/item/%E5%B7%9D%E9%87%8E%E5%A4%AA%E9%83%8E/10962813','川野太郎，演员，参演电影《奥特曼剧场版：第一章》《二十四只眼睛》。'),(8224,'多肉百科分类_百度百科','https://baike.baidu.com/wikicategory/view?categoryName=多肉植物','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8225,'Józef Pawlow