这里你可以参与词条编辑，分享贡献你的知识。'),(8269,'中关村科技园_百度百科','https://baike.baidu.com/item/%E4%B8%AD%E5%85%B3%E6%9D%91%E7%A7%91%E6%8A%80%E5%9B%AD','中关村科技园，起源于20世纪80年代初的“中关村电子一条街”，是中国第一个国家级高新技术产业开发区、第一个国家自主创新示范区、第一个国家级人才特区，也是京津石高新技术产业带的核心园区。中关村科技园是我国体制机制创新的试验田，被誉为“中国硅谷”。1988年5月，国务院批准成立北京市高新技术产业开发试验区，它就是中关村科技园区的前身，1999年8月更名为中关村科技园区，中关村科技园区管理委员会作为北京市政府派出机构对园区实行统一领导和管理。习近平总书记指出，中关村已经成为中国创新发展的一面旗帜，面向未来，要加'),(8270,'百度百科吧-百度贴吧','http://tieba.baidu.com/f?ie=utf-8&fr=bks0000&kw=%E7%99%BE%E5%BA%A6%E7%99%BE%E7%A7%91','本吧热帖: 1-【收集贴】2021年8月份同义词处理专贴 2-【收集贴】2021年7月份同义词处理专贴 3-【收集】锁定词条 内容更新收集贴 4-生活 5-百度百科香港版是由哪个团队负责啊？ 6-大家都是为了什么参与百科编辑？ 7-【高校】娄底潇湘职业学院的百度百科内容乱七八糟，希望帮忙完善 8-百度百科为什么图片采用webp？ 9-【申请词条合并】'),(8271,'2020年东京奥运会_百度百科','https://baike.baidu.com/item/2020%E5%B9%B4%E4%B8%9C%E4%BA%AC%E5%A5%A5%E8%BF%90%E4%BC%9A','第32届夏季奥林匹克运动会（Games of the XXXII Olympiad），即2020年东京奥运会（Tokyo 2020 Olympic Games），是由日本奥林匹克委员会举办的国际性运动会，于2021年7月23日开幕、8月8日闭幕。2020年东京奥运会共有204个国家和地区以及俄罗斯奥运队和奥林匹克难民代表团2个参赛队伍参赛，共11669名参赛运动员；赛事项目共设有33个大项、339个小项、339场金牌赛，其中滑板、冲浪、竞技攀岩、棒垒球和空手道5个项目首次现身奥运会。'),(8272,'快递（社会新形式下衍生出的统一名词）_百度百科','https://baike.baidu.com/item/快递/249416','快递又称速递或快运，是指物流企业(含货运代理) 通过自身的独立网络或以联营合作(即联网)的方式，将用户委托的文件或包裹，快捷而安全地从发件人送达收件人的门到门(手递手)的新型运输方式。快递有广义和狭义之分。广义的快递是指任何货物(包括大宗货件) 的快递;而狭义的快递专指商务文件和小件的紧急递送服务。从服务的标准看，快递一般是指在48 小时之内完成的快件送运服务。从快递的定义中，可以概括出快递的以下3 个特征:从经济类别看，快递是物流产业的一个分支行业，快递研究是从属于物流学的范畴。从业务运作看，快递是一种'),(8273,'百度用户服务中心-百度百科','http://help.baidu.com/question?prod_en=baike&class=89&id=1637','百度服务中心是百度客服官方网站，为您解决使用百度产品过程中遇到的问题，帮助用户更了解百度，也让百度更懂用户。'),(8274,'1001mimimi的个人主页_百度百科','https://baike.baidu.com/usercenter/userpage?uname=1001mimimi&from=home','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8275,'数字人民币_百度百科','https://baike.baidu.com/item/%E6%95%B0%E5%AD%97%E4%BA%BA%E6%B0%91%E5%B8%81','数字人民币（Digital RMB），是由中国人民银行发行的数字形式的法定货币，由指定运营机构参与运营并向公众兑换，以广义账户体系为基础，支持银行账户松耦合功能，与纸钞硬币等价，具有价值特征和法偿性，支持可控匿名。数字人民币的概念有两个重点，一个是数字人民币是数字形式的法定货币；另外一个点是和纸钞和硬币等价，数字人民币主要定位于M0，也就是流通中的现钞和硬币。2019年底数字人民币相继在深圳、苏州、雄安新区