帮助中心','https://baike.baidu.com/help','无法获取此页的描述。'),(8301,'高质量发展_百度百科','https://baike.baidu.com/item/%E9%AB%98%E8%B4%A8%E9%87%8F%E5%8F%91%E5%B1%95','高质量发展是2017年中国共产党第十九次全国代表大会首次提出的新表述，表明中国经济由高速增长阶段转向高质量发展阶段。党的十九大报告中提出的“建立健全绿色低碳循环发展的经济体系”为新时代下高质量发展指明了方向，同时也提出了一个极为重要的时代课题。2021年，恰逢“两个一百年”奋斗目标历史交汇之时。特殊时刻的两会，习近平接连强调“高质量发展”，意义重大。3月5日，国务院总理李克强作政府工作报告时表示，2021年预期目标设定为6%以上，考虑了经济运行恢复情况，有利于引导各方面集中精力推进改革创新、推动高质量发展'),(8302,'世界知识产权组织_百度百科','https://baike.baidu.com/item/世界知识产权组织/122143','世界知识产权组织（World Intellectual Property Organization），简称“WIPO”。联合国保护知识产权的一个专门机构。根据《成立世界知识产权组织公约》而设立。该公约于1967年7月14日在瑞典首都斯德哥尔摩签订，于1970年4月26日生效。中国于1980年6月3日加入了该组织。该组织总部设在日内瓦。2018年12月5日，世界知识产权组织在日内瓦发布《世界知识产权指标》（WIPI）年度报告称，2017年中国在专利、商标和工业品外观设计等方面的知识产权申请数量位居世界第一，'),(8303,'登录百度帐号','https://baike.baidu.com/usercenter','百度帐号是登录所有百度系产品的通行证，登录后还可以在帐户管理页管理/修改您的个人信息，包括修改密码、绑定手机、身份认证等'),(8304,'中国铁路客户服务中心_百度百科','https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%E9%93%81%E8%B7%AF%E5%AE%A2%E6%88%B7%E6%9C%8D%E5%8A%A1%E4%B8%AD%E5%BF%83','中国铁路客户服务中心（12306.cn）是铁路服务客户的重要窗口，将集成全路客货运输信息，为社会和铁路客户提供客货运输业务和公共信息查询服务。客户通过登录网站，可以查询旅客列车时刻表、票价、列车正晚点、车票余票、售票代售点、货物运价、车辆技术参数以及有关客货运规章。铁路货运客户可以通过本网站办理业务。2015年12月铁路部门介绍，并没有设置12月2日或3日的一个时间节点，12306网站随时受理旅客的手机核验业务，通过网站与旅客手机之间互发短信确认可联络性。 自12月1日起，铁路客票系统启用部分新功能，旅客'),(8305,'百度百科合作平台','https://baike.baidu.com/operation/cooperation','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8306,'周迅（华语影视女演员、歌手）_百度百科','https://baike.baidu.com/item/%E5%91%A8%E8%BF%85/10076','周迅，1974年10月18日出生于浙江省衢州市，华语影视女演员、歌手，毕业于浙江艺术学校。1991年，因主演电影《古墓荒斋》而开始演艺生涯。1996年，参演文艺片《风月》。2000年，其主演的电影《苏州河》上映，凭借该片获得第15届巴黎国际电影节最佳女主角奖。2002年，凭借电影《烟雨红颜》获得第25届大众电影百花奖最佳女主角奖。2003年，其首张音乐专辑《夏天》发行。2005年，其主演的电影《如果·爱》首映，凭借该电影获得第25届香港电影金像奖最佳女主角奖、第43届台湾电影金马奖最佳女主角奖。2007年'),(8307,'Sully Boyar_百度百科','https://baike.baidu.com/item/Sully%20Boyar/18670928','Sully Boyar是一个电影演员，代表作品有危险男女等。'),(8308,'消费者物价指数_百度百科','https://baike.baidu.com/item/%E6%B6%88%E8%B4%B9%E8%80%85%E7%89%A9%E4%BB%B7%E6%8C%87%E6%95%B0/9843779','消费者物价指数（Consumer Price Index），又名居民消费价格指数，简称CPI。是一个反映居民家庭一般所购买的消费品和服务项目价格水平变动情况的宏观经济指标。它是在特定时段内度量一组代表性消费商品及服务项目的价格水平随时间而变动的相对数，是用来反映居民家庭购买消费商品及服务的价格水平的变动情况，是一个月内商品和服务零售价变动系数。居民消费价格统计调查的是社会产品和服务项目的最终价格，一方面同人民群众的生活密切相关，同时在整个国民经济价格体系中也具有重要的地位。它是进行经济分析和决策、价格总水'),(8309,'棱果秤锤树_百度百科','https://baike.baidu.com/item/%E6%A3%B1%E6%9E%9C%E7%A7%A4%E9%94%A4%E6%A0%91/8078433','棱果秤锤树（学名：Sinojackia henryi）为安息香科秤锤树属下的一个种。'),(8310,'分类达人团','https://baike.baidu.com/talent/home/index','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8311,'秒懂本尊答_百度百科','https://baike.baidu.com/item/秒懂本尊答','秒懂本尊答是百度公司推出的权威人物短视频品牌。由明星大咖本尊出镜，直面网友最感兴趣的个人及行业话题，分享自身的观点和态度，解读现象背后的知识。让复杂的知识更简单的同时，带你了解人物的另一面。这些本尊亲自回应的权威小视频，将优先于其他第三方结果，通过百度搜索和本人词条，直达用户。这也使“秒懂本尊答”成为明星大咖们表达自我的重要窗口和发声渠道。百度APP搜索“秒懂本尊答”，一键get所有本尊答视频。'),(8312,'Supr_L17的个人主页_百度百科','https://baike.baidu.com/usercenter/userpage?uname=Supr_L17&from=home','百度百科是一部内容开放、自由的网络百科全书，旨在创造一个涵盖所有领域知识，服务所有互联网用户的中文知识性百科全书。在这里你可以参与词条编辑，分享贡献你的知识。'),(8313,'百科商城_百度百科','https://baike.baidu.com/mall/item?id=10731','百科商城是为了奖励百科上热心贡献词条的科友们而提供的财富值消费平台。使用财富值可以兑换特权道具、精美礼品，还能抽奖试试手气！更多精彩兑换持续上架中！'),(8314,'百科商城_百度百科','https://baike.baidu.com/mall/item?id=10724','百科商城是为了奖励百科上热心贡献词条的科友们而提供的财富值消费平台。使用财富值可以兑换特权道具、精美礼品，还能抽奖试试手气！更多精彩兑换持续上架中！'),(8315,'一路“象”北_百度百科','https://baike.baidu.com/item/%E4%B8%80%E8%B7%AF%E2%80%9C%E8%B1%A1%E2%80%9D%E5%8C%97','一路“象”北，是指云南野象群集体北迁事件。2020年3月，象群共计16头野象从西双版纳州进入普洱市，并一直北上。12月，象群在普洱生下一头象宝宝，数量变成17头。2021年4月16日，17头野象进入玉溪元江县。4月24日，两头大象返回普洱墨江县，象群变成15头。5月16日，15头亚洲象到达红河石屏县。5月24日，一头亚洲象落单，另外14头进入玉溪市峨山县。5月25日，落单亚洲象跟上队伍，全部15只亚洲象集体在玉溪市峨山县境内。5月30日，15头亚洲象群迁徙至玉溪市红塔区洛河乡大湾村尖山哨坡附近。5月31日'),(8316,'Disclaimer | Baidu Inc','http://ir.baidu.com/disclaimer','无法获取此页的描述。'),(8317,'News Filings | Baidu Inc','https://baidu.gcs-web.com/news-filings-zh-hans','无法获取此页的描述。'),(8318,'News Filings | Baidu Inc','https://baidu.gcs-web.com/news-filings','无法获取此页的描述。'),(8319,'Corporate Governance | Baidu Inc','http://ir.baidu.com/corporate-governance','无法获取此页的描述。'),(8320,'Contact Form 